import React from 'react'

function Resume() {
  const datas = window.localStorage.getItem('obj')
  const rData =JSON.parse(datas)
  return (
    <div className='container'>
      <div className='ro'>
      {rData.name}
      {rData.Lastname}
      {rData.Gail}
      {rData.Address}
      {rData.Dateofbirth}
      {rData.Qualification}
      {rData.Skills}
      {rData.Maritalstatus}
      {rData.Hobbies}

    </div>
















    </div>
  )
}

export default Resume
